%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0435 \u0432\u043e\u0435\u043d\u043d\u043e-\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0435 \u0441\u0438\u043b\u044b \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438\">\u0412\u0412\u0421 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u043d\u0430\u0447\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BC%D0%B1%D0%B0%D1%80%D0%B4%D0%B8%D1%80%D0%BE%D0%B2%D0%BA%D0%B0_%D0%9B%D1%8E%D0%B1%D0%B5%D0%BA%D0%B0\" title=\"\u0411\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u0440\u043e\u0432\u043a\u0430 \u041b\u044e\u0431\u0435\u043a\u0430\">\u0431\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u0440\u043e\u0432\u043a\u0443 \u0433\u043e\u0440\u043e\u0434\u0430 \u041b\u044e\u0431\u0435\u043a<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1953_%D0%B3%D0%BE%D0%B4\" title=\"1953 \u0433\u043e\u0434\">1953<\/a>&#160;\u2014 \u041e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d \u0423\u043a\u0430\u0437 \u043e\u0431 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%8F\" title=\"\u0410\u043c\u043d\u0438\u0441\u0442\u0438\u044f\">\u0430\u043c\u043d\u0438\u0441\u0442\u0438\u0438<\/a>, \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%B8%D1%8F,_%D0%9B%D0%B0%D0%B2%D1%80%D0%B5%D0%BD%D1%82%D0%B8%D0%B9_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0435\u0440\u0438\u044f, \u041b\u0430\u0432\u0440\u0435\u043d\u0442\u0438\u0439 \u041f\u0430\u0432\u043b\u043e\u0432\u0438\u0447\">\u041b.&#160;\u041f.&#160;\u0411\u0435\u0440\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a>&#160;\u2014 \u0421\u043e\u0437\u0434\u0430\u043d\u0430 \u0430\u0432\u0438\u0430\u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u00ab\u042d\u0440 \u0410\u0444\u0440\u0438\u043a\u00bb&#160;\u2014 \u043e\u0434\u043d\u0430 \u0438\u0437 \u0441\u0442\u0430\u0440\u0435\u0439\u0448\u0438\u0445 \u043f\u0430\u043d\u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0439, \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u044f\u044e\u0449\u0430\u044f 11 \u0437\u0430\u043f\u0430\u0434\u043d\u043e- \u0438 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u0441\u0442\u0440\u0430\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1964_%D0%B3%D0%BE%D0%B4\" title=\"1964 \u0433\u043e\u0434\">1964<\/a>&#160;\u2014 \u041b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%BC%D0%B0%D0%B4%D0%B0%D0%BC_%D0%A2%D1%8E%D1%81%D1%81%D0%BE\" title=\"\u041c\u0443\u0437\u0435\u0439 \u043c\u0430\u0434\u0430\u043c \u0422\u044e\u0441\u0441\u043e\">\u041c\u0443\u0437\u0435\u0439 \u0432\u043e\u0441\u043a\u043e\u0432\u044b\u0445 \u0444\u0438\u0433\u0443\u0440 \u043c\u0430\u0434\u0430\u043c \u0422\u044e\u0441\u0441\u043e<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b, \u0447\u0442\u043e \u0447\u043b\u0435\u043d\u044b \u0433\u0440\u0443\u043f\u043f\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/The_Beatles\" title=\"The Beatles\">The Beatles<\/a>\u00bb \u0441\u0442\u0430\u043d\u0443\u0442 \u043f\u0435\u0440\u0432\u044b\u043c\u0438 \u0440\u043e\u043a-\u043c\u0443\u0437\u044b\u043a\u0430\u043d\u0442\u0430\u043c\u0438, \u0447\u044c\u0438 \u0444\u0438\u0433\u0443\u0440\u044b \u043f\u043e\u044f\u0432\u044f\u0442\u0441\u044f \u0432 \u044d\u043a\u0441\u043f\u043e\u0437\u0438\u0446\u0438\u0438 \u043c\u0443\u0437\u0435\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0435<\/a> \u0443 \u0441\u0442\u0430\u043d\u0446\u0438\u0438 \u043c\u0435\u0442\u0440\u043e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D1%8C%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE,_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3)\" title=\"\u0413\u043e\u0440\u044c\u043a\u043e\u0432\u0441\u043a\u0430\u044f (\u0441\u0442\u0430\u043d\u0446\u0438\u044f \u043c\u0435\u0442\u0440\u043e, \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433)\">\u0413\u043e\u0440\u044c\u043a\u043e\u0432\u0441\u043a\u0430\u044f<\/a>\u00bb \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BA%D1%81%D0%B8%D0%BC_%D0%93%D0%BE%D1%80%D1%8C%D0%BA%D0%B8%D0%B9\" title=\"\u041c\u0430\u043a\u0441\u0438\u043c \u0413\u043e\u0440\u044c\u043a\u0438\u0439\">\u041c\u0430\u043a\u0441\u0438\u043c\u0443 \u0413\u043e\u0440\u044c\u043a\u043e\u043c\u0443<\/a> (\u0441\u043a\u0443\u043b\u044c\u043f\u0442\u043e\u0440\u044b \u0412.&#160;\u0412.&#160;\u0418\u0441\u0430\u0435\u0432\u0430 \u0438 \u041c.&#160;\u0420.&#160;\u0413\u0430\u0431\u0435).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1976_%D0%B3%D0%BE%D0%B4\" title=\"1976 \u0433\u043e\u0434\">1976<\/a>&#160;\u2014 \u041f\u043e\u043b\u044c\u0441\u043a\u0430\u044f \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B8%D1%81%D1%82%D0%B8%D0%BD%D0%B0_%D0%A5%D0%BE%D0%B9%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F-%D0%9B%D0%B8%D1%81%D0%BA%D0%B5%D0%B2%D0%B8%D1%87\" class=\"mw-redirect\" title=\"\u041a\u0440\u0438\u0441\u0442\u0438\u043d\u0430 \u0425\u043e\u0439\u043d\u043e\u0432\u0441\u043a\u0430\u044f-\u041b\u0438\u0441\u043a\u0435\u0432\u0438\u0447\">\u041a\u0440\u0438\u0441\u0442\u0438\u043d\u0430 \u0425\u043e\u0439\u043d\u043e\u0432\u0441\u043a\u0430\u044f-\u041b\u0438\u0441\u043a\u0435\u0432\u0438\u0447<\/a> \u043d\u0430\u0447\u0430\u043b\u0430 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%81-%D0%9F%D0%B0%D0%BB%D1%8C%D0%BC%D0%B0%D1%81\" class=\"mw-redirect\" title=\"\u041b\u0430\u0441-\u041f\u0430\u043b\u044c\u043c\u0430\u0441\">\u041b\u0430\u0441-\u041f\u0430\u043b\u044c\u043c\u0430\u0441\u0430<\/a> \u043f\u0435\u0440\u0432\u043e\u0435 \u0436\u0435\u043d\u0441\u043a\u043e\u0435 \u043e\u0434\u0438\u043d\u043e\u0447\u043d\u043e\u0435 \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043d\u043e\u0435 \u043f\u043b\u0430\u0432\u0430\u043d\u0438\u0435 \u043d\u0430 \u0431\u0435\u0440\u043c\u0443\u0434\u0441\u043a\u043e\u043c \u0448\u043b\u044e\u043f\u0435 \u00ab\u041c\u0430\u0437\u0443\u0440\u0435\u043a\u00bb (9,5 \u043c). \u041b\u0438\u0448\u044c 21 \u043c\u0430\u0440\u0442\u0430 1978&#160;\u0433., \u0441\u043f\u0443\u0441\u0442\u044f \u043f\u043e\u0447\u0442\u0438 \u0434\u0432\u0430 \u0433\u043e\u0434\u0430, \u043e\u043d\u0430 \u0432\u0435\u0440\u043d\u0443\u043b\u0430\u0441\u044c \u043a \u043c\u0435\u0441\u0442\u0443 \u0441\u0432\u043e\u0435\u0433\u043e \u0441\u0442\u0430\u0440\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979_%D0%B3%D0%BE%D0%B4\" title=\"1979 \u0433\u043e\u0434\">1979<\/a>&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 \u043e\u0434\u043d\u0430 \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0442\u044f\u0436\u0451\u043b\u044b\u0445 \u0430\u0432\u0430\u0440\u0438\u0439 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u044f\u0434\u0435\u0440\u043d\u043e\u0439 \u044d\u043d\u0435\u0440\u0433\u0435\u0442\u0438\u043a\u0438&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D0%B0%D1%80%D0%B8%D1%8F_%D0%BD%D0%B0_%D0%90%D0%AD%D0%A1_%D0%A2%D1%80%D0%B8-%D0%9C%D0%B0%D0%B9%D0%BB-%D0%90%D0%B9%D0%BB%D0%B5%D0%BD%D0%B4\" title=\"\u0410\u0432\u0430\u0440\u0438\u044f \u043d\u0430 \u0410\u042d\u0421 \u0422\u0440\u0438-\u041c\u0430\u0439\u043b-\u0410\u0439\u043b\u0435\u043d\u0434\">\u0430\u0432\u0430\u0440\u0438\u044f \u043d\u0430 \u0410\u042d\u0421 \u0422\u0440\u0438-\u041c\u0430\u0439\u043b-\u0410\u0439\u043b\u0435\u043d\u0434<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991_%D0%B3%D0%BE%D0%B4\" title=\"1991 \u0433\u043e\u0434\">1991<\/a>&#160;\u2014 \u0432 \u0434\u0435\u043d\u044c \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u044f III \u0432\u043d\u0435\u043e\u0447\u0435\u0440\u0435\u0434\u043d\u043e\u0433\u043e \u0421\u044a\u0435\u0437\u0434\u0430 \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u0434\u0435\u043f\u0443\u0442\u0430\u0442\u043e\u0432 \u0420\u0421\u0424\u0421\u0420 \u043f\u043e \u043f\u0440\u0438\u043a\u0430\u0437\u0443 \u041c\u0438\u0445\u0430\u0438\u043b\u0430 \u0413\u043e\u0440\u0431\u0430\u0447\u0435\u0432\u0430 \u0432 \u041c\u043e\u0441\u043a\u0432\u0443 \u0431\u044b\u043b\u0438 \u0432\u0432\u0435\u0434\u0435\u043d\u044b \u0432\u043e\u0439\u0441\u043a\u0430, \u0434\u0430\u0431\u044b \u00ab\u043e\u0433\u0440\u0430\u0434\u0438\u0442\u044c\u00bb \u043a\u043e\u043d\u0441\u0435\u0440\u0432\u0430\u0442\u0438\u0432\u043d\u044b\u0445 \u0434\u0435\u043f\u0443\u0442\u0430\u0442\u043e\u0432 \u043e\u0442 \u00ab\u043c\u043e\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0442\u0435\u0440\u0440\u043e\u0440\u0430\u00bb \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u043d\u0442\u043e\u0432 . \u041d\u0435\u0441\u043c\u043e\u0442\u0440\u044f \u043d\u0430 \u0437\u0430\u043f\u0440\u0435\u0442, 28 \u043c\u0430\u0440\u0442\u0430 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u043c\u0430\u0441\u0441\u043e\u0432\u0430\u044f \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u044f \u0432 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0443 \u0415\u043b\u044c\u0446\u0438\u043d\u0430 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1993_%D0%B3%D0%BE%D0%B4\" title=\"1993 \u0433\u043e\u0434\">1993<\/a>&#160;\u2014 \u0412\u0441\u043f\u044b\u0448\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D0%B5%D1%80%D1%85%D0%BD%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B7%D0%B2%D0%B5%D0%B7%D0%B4%D0%B0\" title=\"\u0421\u0432\u0435\u0440\u0445\u043d\u043e\u0432\u0430\u044f \u0437\u0432\u0435\u0437\u0434\u0430\">\u0441\u0432\u0435\u0440\u0445\u043d\u043e\u0432\u043e\u0439<\/a> \u0437\u0432\u0435\u0437\u0434\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/SN_1993J\" title=\"SN 1993J\">SN 1993J<\/a> \u0432 \u0433\u0430\u043b\u0430\u043a\u0442\u0438\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%BB%D0%B0%D0%BA%D1%82%D0%B8%D0%BA%D0%B0_%D0%91%D0%BE%D0%B4%D0%B5\" title=\"\u0413\u0430\u043b\u0430\u043a\u0442\u0438\u043a\u0430 \u0411\u043e\u0434\u0435\">M81<\/a>. \u0412 \u0442\u043e \u0432\u0440\u0435\u043c\u044f \u043e\u043d\u0430 \u0431\u044b\u043b\u0430 \u0432\u0442\u043e\u0440\u043e\u0439 \u043f\u043e \u044f\u0440\u043a\u043e\u0441\u0442\u0438 \u0441\u0432\u0435\u0440\u0445\u043d\u043e\u0432\u043e\u0439, \u043d\u0430\u0431\u043b\u044e\u0434\u0430\u0435\u043c\u043e\u0439 \u0432 XX \u0432\u0435\u043a\u0435. \u041f\u0435\u0440\u0432\u043e\u0439 \u0441\u0432\u0435\u0440\u0445\u043d\u043e\u0432\u043e\u0439 \u0431\u044b\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/SN_1987A\" title=\"SN 1987A\">SN 1987A<\/a>, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0432\u0437\u043e\u0440\u0432\u0430\u043b\u0430\u0441\u044c \u0432 \u0441\u043e\u0441\u0435\u0434\u043d\u0435\u0439 \u0433\u0430\u043b\u0430\u043a\u0442\u0438\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B5_%D0%9C%D0%B0%D0%B3%D0%B5%D0%BB%D0%BB%D0%B0%D0%BD%D0%BE%D0%B2%D0%BE_%D0%9E%D0%B1%D0%BB%D0%B0%D0%BA%D0%BE\" title=\"\u0411\u043e\u043b\u044c\u0448\u043e\u0435 \u041c\u0430\u0433\u0435\u043b\u043b\u0430\u043d\u043e\u0432\u043e \u041e\u0431\u043b\u0430\u043a\u043e\">\u0411\u043e\u043b\u044c\u0448\u043e\u0435 \u041c\u0430\u0433\u0435\u043b\u043b\u0430\u043d\u043e\u0432\u043e \u041e\u0431\u043b\u0430\u043a\u043e<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1987_%D0%B3%D0%BE%D0%B4\" title=\"1987 \u0433\u043e\u0434\">1987 \u0433\u043e\u0434\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1996_%D0%B3%D0%BE%D0%B4\" title=\"1996 \u0433\u043e\u0434\">1996<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D0%BB%D0%B8%D0%BD%D0%B7,_%D0%A4%D0%B8%D0%BB\" title=\"\u041a\u043e\u043b\u043b\u0438\u043d\u0437, \u0424\u0438\u043b\">\u0424\u0438\u043b \u041a\u043e\u043b\u043b\u0438\u043d\u0437<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e \u043d\u0430\u0447\u0430\u043b\u0435 \u0441\u043e\u043b\u044c\u043d\u043e\u0439 \u043a\u0430\u0440\u044c\u0435\u0440\u044b \u0438 \u0432\u044b\u0445\u043e\u0434\u0435 \u0438\u0437 \u0441\u043e\u0441\u0442\u0430\u0432\u0430 \u0433\u0440\u0443\u043f\u043f\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Genesis\" title=\"Genesis\">Genesis<\/a>\u00bb.<\/li><\/ul><h2>"}